import {useEffect, useState} from "react";
import {API_URL} from "../../consts";
import {useNavigate} from "react-router-dom";
import { treeItemClasses } from "@mui/lab";

const DisplayTrials = () => {
    const [trial, setTrial] = useState([]);

    const getTrial = () => {
        fetch(`${API_URL}/displaytrials`, {
            method: 'GET',
        }).then(res => res.json())
            .then(trial => {
                setTrial(trial)
            }).then(console.log(typeof(trial))
            );
    }

    // const getTrial = () => {
    //     fetch(`${API_URL}/displaytrials`)
    //         .then(response => response.json());
    // }

    useEffect(getTrial, []);
    return(
        <>
        <div>

            <input
                //value={trial[0].BriefTitle}
                // onChange={(e) => setTrial({...trial, BriefTitle: e.target.value})}
                className="form-control"/>

        </div>

        <h1>Trials created</h1>
        <ol>
        {
            // console.log(trial.isArray())
            trial.map((t) => {
                return <h3>t.BriefTitle</h3>
            })
         }
        </ol>
        <div>

        </div>
        </>
    );
};
export default DisplayTrials;
